/** Query defines the gRPC querier service for the Arkeo module. */
export interface Query {
  /** Parameters queries the parameters of the module. */
  Params(request: QueryParamsRequest): Promise<QueryParamsResponse>;
  /** FetchProvider queries a specific provider by pubkey and service. */
  FetchProvider(request: QueryFetchProviderRequest): Promise<QueryFetchProviderResponse>;
  /** ProviderAll queries for a list of all providers. */
  ProviderAll(request: QueryAllProviderRequest): Promise<QueryAllProviderResponse>;
  /** FetchContract queries a specific contract by contract_id. */
  FetchContract(request: QueryFetchContractRequest): Promise<QueryFetchContractResponse>;
  /** ContractAll queries for a list of all contracts. */
  ContractAll(request: QueryAllContractRequest): Promise<QueryAllContractResponse>;
  /**
   * ActiveContract queries an active contract by provider, service, and
   * spender.
   */
  ActiveContract(request: QueryActiveContractRequest): Promise<QueryActiveContractResponse>;
  /** Returns a list of all service enum values and descriptions. */
  AllServices(request: QueryAllServicesRequest): Promise<QueryAllServicesResponse>;
  /** Returns a single service by name or id. */
  Service(request: QueryServiceRequest): Promise<QueryServiceResponse>;
}

